import React from "react";
import { Modal } from "antd";
const CustomModal = ({ visible, handleOk, handleClose }) => {
  return (
    <Modal visible={visible} onOk={handleOk} onCancel={handleClose}></Modal>
  );
};

export default CustomModal;
